export async function newStuden(student: NewPerson, collec: string) {

    const id = uuidv4(); //24-36

    try {
        const docRef = await setDoc(doc(db, collec, id.slice(24, 36)), { ...student, uuid: id.slice(24, 36) });
        return docRef
    } catch (error) {
        throw new Error(`Error: ${error}`);
    }

}

