export async function newAuthorized(authorized: NewPerson) {

    try {
        const createUser = await signUp(authorized.contactData?.email, authorized.contactData?.password);
        const addUser = await newStuden(authorized, 'authorizeds');
        return {addUser, createUser};
    } catch (error) {
        throw new Error(`${error}`);
    }

}